import React, { useEffect, useRef, useState, useCallback } from 'react';

// Vec2.js
class Vec2 {
  constructor(x, y) {
    this.x = x;
    this.y = y;
  }

  length() {
    return Math.sqrt(this.x * this.x + this.y * this.y);
  }

  add(vec) {
    return new Vec2(vec.x + this.x, vec.y + this.y);
  }

  subtract(vec) {
    return new Vec2(this.x - vec.x, this.y - vec.y);
  }

  scale(n) {
    return new Vec2(this.x * n, this.y * n);
  }

  dot(vec) {
    return this.x * vec.x + this.y * vec.y;
  }

  cross(vec) {
    return this.x * vec.y - this.y * vec.x;
  }

  rotate(center, angle) {
    let r = [];
    let x = this.x - center.x;
    let y = this.y - center.y;
    r[0] = x * Math.cos(angle) - y * Math.sin(angle);
    r[1] = x * Math.sin(angle) + y * Math.cos(angle);
    r[0] += center.x;
    r[1] += center.y;
    return new Vec2(r[0], r[1]);
  }

  normalize() {
    let len = this.length();
    if (len > 0) {
      len = 1 / len;
    }
    return new Vec2(this.x * len, this.y * len);
  }

  distance(vec) {
    let x = this.x - vec.x;
    let y = this.y - vec.y;
    return Math.sqrt(x * x + y * y);
  }
}

// RigidShape.js
class RigidShape {
  constructor(center) {
    this.mCenter = center;
    this.mAngle = 0;
  }

  update() {
    if (this.mCenter.y < 450 && this.mFix !== 0) {
      this.move(new Vec2(0, 1));
      this.rotate(0.1);
    }
  }
}

// Rectangle.js
class Rectangle extends RigidShape {
  constructor(center, width, height, fix) {
    super(center);
    this.mType = "Rectangle";
    this.mWidth = width;
    this.mHeight = height;
    this.mVertex = [];
    this.mFaceNormal = [];
    this.mFix = fix;

    this.mVertex[0] = new Vec2(center.x - width / 2, center.y - height / 2);
    this.mVertex[1] = new Vec2(center.x + width / 2, center.y - height / 2);
    this.mVertex[2] = new Vec2(center.x + width / 2, center.y + height / 2);
    this.mVertex[3] = new Vec2(center.x - width / 2, center.y + height / 2);
  }

  draw(context) {
    context.save();
    context.translate(this.mVertex[0].x, this.mVertex[0].y);
    context.rotate(this.mAngle);
    context.strokeRect(0, 0, this.mWidth, this.mHeight);
    context.restore();
  }

  move(v) {
    for (let i = 0; i < this.mVertex.length; i++) {
      this.mVertex[i] = this.mVertex[i].add(v);
    }
    this.mCenter = this.mCenter.add(v);
    return this;
  }

  rotate(angle) {
    this.mAngle += angle;
    for (let i = 0; i < this.mVertex.length; i++) {
      this.mVertex[i] = this.mVertex[i].rotate(this.mCenter, angle);
    }
    this.mFaceNormal[0] = this.mVertex[1].subtract(this.mVertex[2]).normalize();
    this.mFaceNormal[1] = this.mVertex[2].subtract(this.mVertex[3]).normalize();
    this.mFaceNormal[2] = this.mVertex[3].subtract(this.mVertex[0]).normalize();
    this.mFaceNormal[3] = this.mVertex[0].subtract(this.mVertex[1]).normalize();
    return this;
  }
}

const App = () => {
  const canvasRef = useRef(null);
  const [allObjects, setAllObjects] = useState([]);

  useEffect(() => {
    const canvas = canvasRef.current;
    const context = canvas.getContext('2d');
    const width = 800;
    const height = 450;
    canvas.width = width;
    canvas.height = height;

    let r1 = new Rectangle(new Vec2(200, 200), 40, 40, false);
    setAllObjects([r1]);

    const runGameLoop = () => {
      context.clearRect(0, 0, width, height);

      allObjects.forEach(obj => {
        obj.update();
        obj.draw(context);
      });

      requestAnimationFrame(runGameLoop);
    };

    runGameLoop();

    return () => {
      // Clean up logic if needed
    };
  }, []); // Empty dependency array ensures useEffect runs only once

  const handleKeyDown = useCallback((event) => {
    const keycode = event.keyCode || event.which;
    if (keycode === 70) { // F
      let r1 = new Rectangle(new Vec2(allObjects[0].mCenter.x + 200, allObjects[0].mCenter.y + 20), Math.random() * 30 + 10, Math.random() * 30 + 10);
      setAllObjects(prevObjects => [...prevObjects, r1]);
    }
    // Add other key handling logic here
  }, [allObjects]);

  useEffect(() => {
    window.addEventListener('keydown', handleKeyDown);
    return () => {
      window.removeEventListener('keydown', handleKeyDown);
    };
  }, [handleKeyDown]);

  return (
    <div>
      <canvas ref={canvasRef} style={{ border: '1px solid black' }}></canvas>
    </div>
  );
};

export default App;
